import React, { useEffect, useState, useMemo } from "react";
import { API_BASE_URL } from "../apiConfig";
import colorMapping from "../colorMapping.json";
import "./Modif.css";

interface DataItem {
  id_pers: number;
  id_subject: number;
  name: string;
  firstname: string;
  subject: string;
  type: string;
  comment?: string;
  month: string;
  load: number;
  team: string;
  color_hex?: string;
}

interface GroupedData {
  id_pers: number;
  id_subject: number;
  name: string;
  firstname: string;
  subject: string;
  type: string;
  comment: string;
  loads: { [key: string]: number };
  team: string;
  color_hex?: string;
  [key: string]: any;
}

function Modif() {
  const [data, setData] = useState<DataItem[]>([]);
  const [groupedData, setGroupedData] = useState<GroupedData[]>([]);
  const [months, setMonths] = useState<string[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [sortConfig, setSortConfig] = useState<{ key: string; direction: string }>({
    key: "name",
    direction: "ascending",
  });

  const [nameFilter, setNameFilter] = useState("");
  const [subjectFilter, setSubjectFilter] = useState("");
  const [teamFilter, setTeamFilter] = useState("");

  const [minMonth, setMinMonth] = useState("");
  const [maxMonth, setMaxMonth] = useState("");

  const [userId, setUserId] = useState("");

  const [editing, setEditing] = useState<{ id_pers: number; id_subject: number; month: Date } | null>(null);
  const [newLoad, setNewLoad] = useState<number | null>(null);

  const [editingComment, setEditingComment] = useState<{ id_pers: number; id_subject: number } | null>(null);
  const [newComment, setNewComment] = useState<string | null>(null);

  const [showAddLineForm, setShowAddLineForm] = useState(false);
  const [availableNames, setAvailableNames] = useState<string[]>([]);
  const [availableSubjects, setAvailableSubjects] = useState<string[]>([]);
  const [selectedName, setSelectedName] = useState("");
  const [selectedSubject, setSelectedSubject] = useState("");

  //
  // ---- API UTILITIES --------------------------------------------------------
  //
  const apiGet = (url: string) => fetch(url).then((res) => res.json());

  const refreshFilteredData = async (uid: string) => {
    try {
      const related = await apiGet(`${API_BASE_URL}/api/related-persons?id_pers=${uid}`);
      const relatedIds = related.map((p: any) => p.id_pers);
      const serverData = await apiGet(`${API_BASE_URL}/api/data`);
      const filteredData = serverData.filter((d: DataItem) => relatedIds.includes(d.id_pers));

      setData(filteredData);
      processData(filteredData);
    } catch (e) {
      console.error(e);
    }
  };

  //
  // ---- STARTUP --------------------------------------------------------------
  //
  useEffect(() => {
    const now = new Date();

    const min = new Date(now);
    min.setMonth(now.getMonth() - 1);
    setMinMonth(min.toISOString().split("T")[0]);

    const max = new Date(now);
    max.setMonth(now.getMonth() + 18);
    setMaxMonth(max.toISOString().split("T")[0]);
  }, []);

  useEffect(() => {
    const token = localStorage.getItem("jwtToken");

    if (!token) {
      document.title = "Modif";
      return;
    }

    const decoded = JSON.parse(atob(token.split(".")[1]));
    const uid = decoded.userId;

    setUserId(uid);
    document.title = `Modif - User: ${uid}`;

    (async () => {
      try {
        // Load initial filtered data
        await refreshFilteredData(uid);

        // fetch names
        const related = await apiGet(`${API_BASE_URL}/api/related-persons?id_pers=${uid}`);
        const relatedIds = related.map((p: any) => p.id_pers);

        const persons = await apiGet(`${API_BASE_URL}/api/persons`);
        setAvailableNames(
          persons.filter((p: any) => relatedIds.includes(p.id_pers)).map((p: any) => `${p.name} ${p.firstname}`)
        );

        // fetch subjects
        const subjects = await apiGet(`${API_BASE_URL}/api/subjects`);
        setAvailableSubjects(subjects.map((s: any) => s.subject));
      } catch (e: any) {
        setError(e.message);
      } finally {
        setLoading(false);
      }
    })();
  }, []);

  //
  // ---- DATA GROUPING --------------------------------------------------------
  //
  const processData = (data: DataItem[]) => {
    const grouped: { [key: string]: GroupedData } = {};
    const monthSet = new Set<string>();

    data.forEach((item) => {
      monthSet.add(item.month);

      const key = `${item.name}-${item.firstname}-${item.subject}-${item.comment ?? "No comment"}`;

      if (!grouped[key]) {
        grouped[key] = {
          id_pers: item.id_pers,
          id_subject: item.id_subject,
          name: item.name,
          firstname: item.firstname,
          subject: item.subject,
          type: item.type,
          comment: item.comment ?? "No comment",
          team: item.team ?? "Unknown",
          loads: {},
          color_hex: item.color_hex ?? "",
        };
      }

      grouped[key].loads[item.month] = item.load;
    });

    setGroupedData(Object.values(grouped));
    setMonths([...monthSet].sort());
  };

  //
  // ---- ADD NEW LINE ---------------------------------------------------------
  //
  const handleAddLine = async () => {
    if (!selectedName || !selectedSubject || !userId) return;

    try {
      const [persons, subjects] = await Promise.all([
        apiGet(`${API_BASE_URL}/api/persons`),
        apiGet(`${API_BASE_URL}/api/subjects`),
      ]);

      const [name, firstname] = selectedName.split(" ");

      const person = persons.find((p: any) => p.name === name && p.firstname === firstname);
      const subject = subjects.find((s: any) => s.subject === selectedSubject);

      if (!person || !subject) return console.error("Person or subject not found");

      await fetch(`${API_BASE_URL}/api/addNewLine`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ id_pers: person.id_pers, id_subject: subject.id_subject }),
      });

      await refreshFilteredData(userId);

      setShowAddLineForm(false);
      setSelectedName("");
      setSelectedSubject("");
    } catch (e) {
      console.error(e);
    }
  };

  //
  // ---- SORT + FILTER --------------------------------------------------------
  //
  const requestSort = (key: string) => {
    setSortConfig((prev) =>
      prev && prev.key === key && prev.direction === "ascending"
        ? { key, direction: "descending" }
        : { key, direction: "ascending" }
    );
  };

  const filteredGroupedData = useMemo(() => {
    return groupedData
      .filter((i) => (!nameFilter ? true : i.name.toLowerCase().includes(nameFilter.toLowerCase())))
      .filter((i) => (!subjectFilter ? true : i.subject.toLowerCase().includes(subjectFilter.toLowerCase())))
      .filter((i) => (!teamFilter ? true : i.team.toLowerCase().includes(teamFilter.toLowerCase())));
  }, [groupedData, nameFilter, subjectFilter, teamFilter]);

  const sortedGroupedData = useMemo(() => {
    if (!sortConfig) return filteredGroupedData;

    return [...filteredGroupedData].sort((a, b) => {
      if (a[sortConfig.key] < b[sortConfig.key]) return sortConfig.direction === "ascending" ? -1 : 1;
      if (a[sortConfig.key] > b[sortConfig.key]) return sortConfig.direction === "ascending" ? 1 : -1;
      return 0;
    });
  }, [filteredGroupedData, sortConfig]);

  //
  // ---- MONTH RANGES ---------------------------------------------------------
  //
  const handleMonthChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    const { name, value } = e.target;
    if (name === "minMonth" && (!maxMonth || value <= maxMonth)) setMinMonth(value);
    if (name === "maxMonth" && (!minMonth || value >= minMonth)) setMaxMonth(value);
  };

  const filteredMonths = useMemo(() => {
    return months.filter((m) => {
      if (minMonth && m < minMonth) return false;
      if (maxMonth && m > maxMonth) return false;
      return true;
    });
  }, [months, minMonth, maxMonth]);

  //
  // ---- CELL COLORING --------------------------------------------------------
  //
  const getBackgroundColor = (load: number) => {
    const keys = Object.keys(colorMapping);
    const values = Object.values(colorMapping);

    if (load <= 0) return values[0];
    if (load >= 30) return values[values.length - 1];

    for (let i = 0; i < keys.length - 1; i++) {
      const k1 = parseInt(keys[i], 10);
      const k2 = parseInt(keys[i + 1], 10);

      if (load >= k1 && load < k2) {
        const ratio = (load - k1) / (k2 - k1);
        const c1 = parseInt(values[i].slice(1), 16);
        const c2 = parseInt(values[i + 1].slice(1), 16);

        const r = Math.round(((c2 >> 16) & 255) * ratio + ((c1 >> 16) & 255) * (1 - ratio));
        const g = Math.round(((c2 >> 8) & 255) * ratio + ((c1 >> 8) & 255) * (1 - ratio));
        const b = Math.round((c2 & 255) * ratio + (c1 & 255) * (1 - ratio));

        return `#${(r << 16 | g << 8 | b).toString(16).padStart(6, "0")}`;
      }
    }
    return values[0];
  };

  const getTextColor = (bg: string) => {
    const r = parseInt(bg.substring(1, 3), 16);
    const g = parseInt(bg.substring(3, 5), 16);
    const b = parseInt(bg.substring(5, 7), 16);
    const lum = (0.299 * r + 0.587 * g + 0.114 * b) / 255;
    return lum > 0.5 ? "#000" : "#fff";
  };

  //
  // ---- UI RENDER ------------------------------------------------------------
  //
  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div>
      {/* ---- HEADER ---- */}
      <h1>Modif page - User: {userId}</h1>

      {/* filters ...  */}
      {/* tableau ...  */}
    </div>
  );
}

export default Modif;
